import java.util.HashMap;

public class AnagramString {

    public static boolean isAnagram(String s, String t) {
        if(s.length() != t.length())
            return false;

        if(s.length() == 1 && s.equals(t))
            return true;

        HashMap<String, Integer> smap = new HashMap<>();
        HashMap<String, Integer> tmap = new HashMap<>();

        for(int i = 0; i < s.length(); i++) {
            if(smap.get(s.charAt(i)+"") == null) {
                smap.put(s.charAt(i)+"", 1);
            }
            else {
                int value = smap.get(s.charAt(i)+"");
                smap.put(s.charAt(i)+"", value + 1);
            }
        }

        for(int i = 0; i < t.length(); i++) {
            if(tmap.get(t.charAt(i)+"") == null) {
                tmap.put(t.charAt(i)+"", 1);
            }
            else {
                int value = tmap.get(t.charAt(i)+"");
                tmap.put(t.charAt(i)+"", value + 1);
            }
        }

        for(int i = 0; i < t.length(); i++) {
            String key = t.charAt(i)+"";
            if(smap.get(key) == null)
                return false;
            else if(!smap.get(key).equals(tmap.get(key)))
                return false;
        }

        return true;

    }

    public static void main(String[] args) {
        String s = "";
        String t = "";

        System.out.println(isAnagram(s,t));


    }

}
